text:
🙏🏻 Buon compleanno al governatore della #Lega del Friuli Venezia-Giulia e presidente della conferenza delle regioni. 

Auguri Massimiliano Fedriga🥂
@massimilianofedriga 👏🏻 https://t.co/oZPuc0zAB5

@elio_vito Non conoscevo la vicenda e la persona ed il tuo accanimento mi ha portato ad informarmi.
È entrato 5 anni fa con CP, verissimo. Ne è uscito ed ha fatto una lista civica.
Con la tua logica l’unica condanna possibile sarebbe l’ergastolo e gli errori si pagherebbero a vita.

Dopo due anni di stop a #Siena torna il #Palio, una delle tradizioni più sentite del nostro Paese. Una bellissima festa per la città e per tutti i senesi.

Grazie al Sindaco @DeMossi2 per l’ospitalità.

@Antonio_Tajani https://t.co/wJp45Fg16y

